ton_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_telegram"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram"></use></svg></div> <!----> <!----></div></div></button></div> <div class="absolute bottom-0 left-0 z-30"><button type="button" class="shadow-inner-white base-button base-button_theme_green base-button_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_whatsapp"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div></div></div><script>window.__NUXT__=(function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r){r.id=77;r.slug=a;r.title=g;r.url=a;r.protocol=c;r.type={code:h,description:"Роут"};r.createdAt="2021-09-30T19:13:44+03:00";r.updatedAt="2021-09-30T19:39:09+03:00";r.meta={title:a,description:a,keywords:a};r.content={id:346,text:a,blocks:[]};r.children=[];return {layout:"default",data:[{post:{title:"10 сервисов для самостоятельного нейминга",slug:"10-servisov-dlya-samostoyatelnogo-neyminga",shortDescription:"Красивое, звучное, запоминающееся и&nbsp;легко произносимое имя бренда&nbsp;&mdash; один из&nbsp;ключевых элементов, предопределяющих успех проекта. Создание такого названия является очень интересной, но&nbsp;в&nbsp;то&nbsp;же время сложной задачей, требующей участия многих сотрудников нейминг-агентства или креативной студии.",createdAt:"2021-12-09T00:00:00+03:00",isImported:f,image:{file:{url:"\u002Fuploads\u002Ffile\u002Fd\u002F3\u002F4\u002Fd34d02cb3c428af164f8dd5b68a539b7.png",name:"d34d02cb3c428af164f8dd5b68a539b7.png",originalName:"cover.png",extension:"png",size:"176.7 Кб"}},content:{id:457,text:"\u003Cp\u003EКрасивое, звучное, запоминающееся и&nbsp;легко произносимое имя бренда&nbsp;&mdash; один из&nbsp;ключевых элементов, предопределяющих успех проекта. Создание такого названия является очень интересной, но&nbsp;в&nbsp;то&nbsp;же время сложной задачей, требующей участия многих сотрудников нейминг-агентства или креативной студии. Как правило, в&nbsp;команду включают маркетологов, стратегов, копирайтеров, специалистов по&nbsp;брендингу и&nbsp;т.д. На&nbsp;предварительном этапе проводится исследование рынка, целевой аудитории, товара и&nbsp;т.д. Затем формируется пул названий, состоящий из&nbsp;сотен слов, ассоциативно связанных с&nbsp;брендом или продуктом. Далее отсеиваются все неподходящие (неблагозвучные, неуникальные и&nbsp;т.д.) слова и&nbsp;формируется финальный список. На&nbsp;завершающем этапе заказчик делает окончательный выбор, после чего название направляется в&nbsp;Роспатент для регистрации.\u003Cbr\u003E\u003Cbr\u003EВ&nbsp;идеальном мире процесс разработки названия выглядит именно так, как описано выше. Но, к&nbsp;сожалению, мы&nbsp;живем в&nbsp;реальности, которой до&nbsp;идеала очень и&nbsp;очень далеко. Часто случается так, что из-за недостатка средств на&nbsp;старте проекта или по&nbsp;иным причинам предприниматели вынуждены самостоятельно придумывать название компании или продукта. И&nbsp;в&nbsp;этом им&nbsp;готовы помочь многочисленные нейминг-генераторы, с&nbsp;помощью которых можно создать имя бренда. Предлагаем вашему вниманию обзор нескольких приложений и&nbsp;сервисов.\u003Cbr\u003E\u003Cbr\u003E\u003Cstrong\u003E№&nbsp;1. Wordlab\u003C\u002Fstrong\u003E \u003Cbr\u003E\u003Cbr\u003EНесколько тематических генераторов, объединенных на&nbsp;одном сайте. Здесь можно подобрать нейм для ресторана, бизнеса, строительного проекта, музыкальной группы, фармацевтического препарата и&nbsp;т.д. Интерфейс, равно как и&nbsp;генерируемые названия, англоязычный. До&nbsp;недавнего времени на&nbsp;сайте был форум, где можно было пообщаться с&nbsp;более опытными пользователями и&nbsp;получить помощь участников проекта. В&nbsp;ноябре 2021 года было принято решение о&nbsp;его закрытии. Однако все темы сохранены и&nbsp;находятся в&nbsp;общем доступе. Их&nbsp;можно просматривать и&nbsp;использовать как копилку знаний.\u003Cbr\u003E\u003Cbr\u003EПреимущества: тематические генераторы, работающие в&nbsp;узкой нише, а&nbsp;также почти неограниченный выбор названий.\u003Cbr\u003E\u003Cbr\u003EНедостатки: требует уверенного владения английским языком, малопривлекательный интерфейс сайта, нет возможности создавать русские названия.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAFxeSURBVHgB7d0JkJ71fR\u002Fwv80lAZLQATrQjTglcQgBBkNsE3zFniR03NhxO87kmKQznabtNNOknWmbtNPJTNM0TVxPpsk4ccd10vioHR+xjS+MAXMJoQsJdKILCZ0ISUgI4eb7T5\u002FNIuvY493dZ3c\u002Fn5lndrW69n32Xaz36+\u002Fv93\\u002F5kc\u002F+lEZDG95y1sKAABnJ8ACADiNBFidCLFOF1B1\u002F1j+DiEWAMDZCbAAgFGheyA1WO2qM\u002F1d\u002Ffn7m7Dr1LcAACOZHVgAwKgymOEVAACdoYEFAAxrpwZSb7zxxjl\u002FT1pLY8aMqdfYsWPLW9\u002F61nqdf\u002F755dJLL63XnDlz6s+NGzeuXHLJJfVjl19+ef11kbf5c06cONH1OZw8ebK+\u002F\u002Frrr9fPI2+PHz9e3z969Gh57bXX6o+PHDlSf98rr7xSf5zr8OHDXR979dVX6\u002FXyyy\u002F\u002F2OPpaYus+TybxwsAMJwJsACAYeFsgc2pP9cENhdffHENci677LJy4YUX1iCqeX\u002Fy5MnloosuqiHWeeedV39PAqz8nvy6hFX5cUKs\u002FJr8nvHjx79pdC9XQqrmc2iuhE55m0CrCbMSTuXHCbFy5ePHjh2rb7u\u002Ff+jQoa4AK+83vz6\u002FP28ThOX9\u002FPrm9yQQy5+dIOx09+Rse7aEWwDAcCDAAgCGhd4uVW+Cq4RPCxcuLBMnTiyzZ88u11xzTX1\u002F\u002Fvz5NcDKlQCraWA1oVbTsBosCblyNQFWwqk0sPL+\u002Fv3768fTztq+fXtta+3atavs3bu3hldbt26t4VUCrjM1tE79cfeGFgBA273lb\