ощью можно подбирать названия по&nbsp;сфере деятельности компании, по&nbsp;категории продукта, а&nbsp;также креативные, цепляющие, короткие, современные и&nbsp;т.д. Все это можно задать перед генерацией и&nbsp;получить список имен, соответствующих предпочтениям конкретного пользователя. Кроме того, на&nbsp;Brand Bucket есть пакетные предложения. Например, можно купить не&nbsp;только вручную сформированное и&nbsp;проверенное на&nbsp;уникальность название, но&nbsp;и&nbsp;логотип. Средняя стоимость таких пакетов 2500-3000&nbsp;долларов, но&nbsp;есть и&nbsp;более дешевые\u002Fдорогие предложения.\u003Cbr\u003EПреимущества: удобный интерфейс, хорошее качество названий, огромный выбор вариантов, множество способов фильтрации.\u003Cbr\u003EНедостатки: отсутствие бесплатной версии, генерирует только англоязычные названия, требует знания английского языка хотя&nbsp;бы на&nbsp;начальном уровне.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAR3WSURBVHgB7L0JvCTXVd9\u002FaunlbbOvmpE02pexLNmWbNnGFgbjBIJjAgTHkJWYBD5x7BAWYwIxiSEkDmCCDQ4fTEgwOLEJIfw\u002FgA1hsY0ty6v2bcbSaCTNPvNmeWsvVfW\u002F59w63bfrdffr97r7vV5+31HrvdddXXXr1q3qOr\u002F+nXO9xEAAAAA2BL3kep5Hw8IwthlsDhgra4f7rFV\u002FtXsNgM0E57oF5y8AAGwsPgEAAAAAAAAAAAAAMMB4cGABAEDvcS+t3X4Du9pletS\u002F4cX+j\u002Ff+jzrNji+OKRgWBt2JtVkOqWF2qPXi\u002FmW1\u002FYeDDwCwXuDAAgAAAAAAAAAAAAADTUgAAAB6Ti+\u002FVRz3byix\u002F\u002FiGGgAAwMaAzxwAwCADBxYAAAAAAAAAAAAAGGggYAEAAAAAAAAAAACAgQYCFgAAAAAAAAAAAAAYaFADCwAAuqSXMw4CAAAAnYJZSrsDs9xu7v1Lt\u002F2ffT\u002FGOwCjDxxYAAAAAAAAAAAAAGCg8ZLVpG8AAACgDXAAALB+Rt3ByfvXar\u002FavQbARoDPLwAAGC7gwAIAAAAAAAAAMLTAkwHAeIAaWAAAALoC31ADsH5w\u002FgAAwPqBcAXAeAEBCwAAAAAAAADA0IEvAQAYL5BCCAAAAAAAAAAAAAAGGjiwAAAAAAAAAAAMFdn0QbixABh9IGABAFYFs\u002FQAAMD6WM\u002F1cy0zE4769RmfP93RbX2gfo8\u002FjN\u002FxHr+oXwUAWCsQsAAAAAAAAAAADBUQsAEYP7wE0jcAAIw0+Aa4Pdw\u002Frfqg3WsbhR6\u002FTtqxlmXHBY