8ygmfbxm3b7WPb3p7K370W\u002F\u002Foc1rf2Y5PHr9p6uj\u002FVaRvFvk\u002Fo3YRTzbt+zbL\u002F9zgWA5UEGFgAAAAAAAEqNGlgAAACBSX6KT5HsxTbvjI6yr3\u002FcDJtpt\u002F9Vz8jh+ANYNgSwAACYIwIYwOJiCDgAALPDEEIAAAAAAACUGhlYAAAA6IoMIgAAUBb\u002FP48rhmKCJT5IAAAAAElFTkSuQmCC\"\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Cstrong\u003E№&nbsp;6. Play Name\u003C\u002Fstrong\u003E \u003Cbr\u003E\u003Cbr\u003EИнтересный нейминг-генератор, работающий на&nbsp;базе искусственного интеллекта. В&nbsp;бесплатной версии есть возможность создать название на&nbsp;русском и&nbsp;английском языках. В&nbsp;платной количество языков увеличено до&nbsp;двадцати. Предлагает как неологизмы, так и&nbsp;словосочетания из&nbsp;двух-трех слов.\u003Cbr\u003EБесплатный сервис достаточно прост работе. От&nbsp;пользователя требуется только указать направление деятельности компании, а&nbsp;также перечислить несколько существительных и&nbsp;прилагательных, имеющих отношение к&nbsp;продукту. Платный раздел предлагает больше инструментов, поэтому для изучения всех возможностей может потребоваться время.\u003Cbr\u003EПреимущества: три тарифных плана, стоимость которых зависит от&nbsp;длительности и&nbsp;варьируется от&nbsp;199 до&nbsp;550&nbsp;рублей. В&nbsp;рамках платной версии программа позволяет вести неограниченное количество проектов, а&nbsp;также дает возможность проверить уникальность выбранного нейма. Генерирует небанальные имена, которые легко произносятся.\u003Cbr\u003EНедостатки: изучение функционала сайта требует времени. Бесплатно можно сгенерировать только одно название.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAbLHSURBVHgB7J0HgNxmmff\u002F0rTtvXvde4ntOE7vnSSEkNADhN6O3jngOODuOMpHb8dRjt5CIBAI6T12ilMcx72v11u8vU+Vvud5Jc3OrtclkLL2\u002Fn+JLM2MpHn1SjO7+u3zPK\\u002FBmNcuvOh8nHXWGYzIIuQ4hQKLkOOQnp4eXH\u002F9H8dEXPX19WLdukfw1Ib1jLIihBBCCCHHPIHMOuusc2TZi74qLy\u002FHi6+8DEuWLAYh5