ft51cVryqNWP2FNvJyuUNAOg+KPIui+lr4dik\u002FycXWMF+ev+8bVcOUez3TE9bwQahZNHwsXJiWGy\u002F87Jdh7gvpRnFT17DZ+p3t+bmEn22YZq6BH1cR85u5lrfZOoy19WbT4OH5da6qCz+PmF1VZUrl6acxl\u002FSr4jd7TVuh\u002FT\u002F55JOJvkyUfWDVNYmVwQ8Ts61RWqm+ttGxWF5V+bs22F0nfCyu9kl310zod\u002FH6ycOQU8ezaf88TrPxZ+OvVeN2zOaqcjd7rlFdx867Nlqfjdte7R+p9P14amxXfylf37Bhw6za\u002F\u002Fr165Nhh4eHg7Zgwhu4CDU4OCjfD5Lxx\\"\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Cstrong\u003E№&nbsp;8. Плановик.ру\u003C\u002Fstrong\u003E \u003Cbr\u003E\u003Cbr\u003EГенератор названий для брендов и&nbsp;продуктов, имен для персонажей и&nbsp;т.д. Работает по&nbsp;принципу создания новых слов, не&nbsp;существующих в&nbsp;русском языке. Позволяет задать количество букв и&nbsp;генерируемых неймов. При некоторой настойчивости пользователь может подобрать неплохой вариант названия, но&nbsp;чаще сервис выдает искусственные слова, которые характеризуются плохой произносимостью и&nbsp;запоминаемостью. \u003Cbr\u003EПреимущества: простой и&nbsp;понятный интерфейс, абсолютно бесплатная генерация, неограниченное время использования.\u003Cbr\u003EНедостатки: невозможно задать сферу деятельности компании, названия представляют собой случайное сочетание букв.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAMXuSURBVHgB7P0HnBRXmuf9PpnlvaWqKHzhrYSQkAEh771tSW2k1nT3zs7O7M68Y3bfu\u002FezO3dnZmd7u8e2Vxt1t2zLO+SFkEGAAAnvobynvLd5n+ekIasoEEggRcLv252qNJERkZkRQZ5\u002FPueEL6AEAAAAAAAA8Ci\\u002F48eOlpGSaFBePl+TkZAFwZvEFlAA4Ixw8WCo7d+6STRs\u002FJagCAABAzJpWMlWWLDlHL4sFwJmBAAs4A2za9Ims+XCtq7Yara+vV+rr66WtrU1DrR693ScAAACAFyQlJUl2do77W1hYqH9HVl7l5ORIiYZZV1x5uavSAnD6IsACTmNWbfXKy69KS0tr5D4LrPbu3SsVFWV6qZC29lYBAAAAYkFhQZEUFBTIrFlzZObMWZH7Lcg6Z8nZcqUGWQBOTwRYwGmopaVFnn76OSk9WBa5r62tVTZu\u002FFi2bttClRUAAABiXlZWlkyeNEWWL1+h14PVVxZkffd7D1KNBZyGCLCA04xVXT391HORMa6s4urtt9+Ubdu3CgAAAHA6Ou\u002FcpXKuXsJB1hVXXkY1FnCaIcACTiNvv71K3nn73c