тоте сервис предлагает несколько инструментов, позволяющих настроить его под себя. К&nbsp;примеру, пользователь может выбрать количество не&nbsp;только букв в&nbsp;слове, но&nbsp;и&nbsp;одновременно генерируемых названий. Кроме того, вместе с&nbsp;подбором русскоязычных неймов приложение выдает и&nbsp;их&nbsp;транслитерацию.\u003Cbr\u003EПреимущества: возможность генерировать неограниченное количество названий, бесплатное использование, простой, но&nbsp;функциональный интерфейс.\u003Cbr\u003EНедостатки: очень часто выдает непроизносимый набор случайных букв.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAH3dSURBVHgB7N0FfJ3V\u002FcfxbyVtXNum7u7uLrRoodiQwYDhrgPGGGyMwYb8t6Fj6HAZXuru7m6pp2ncmqQt\u002F3OeLKVltLTNvTfnJp\\u002F\u002F33Rz6Op1KlSkc+AAA4GQRYAAAAAHxm5YrF2pa0XZs3Jx03xIqPi1Kr1m3Us2cfValSRQAA\u002FBwCLAAAAACldvjwYR06dEizZk3R1Ckz9e13k1RUdPAnv7d1y4a68KJL1KFDJ0VERLISCwDwsyp9f6K1vQAAAADwM2x49f777+qpPz+hnbuSVVhYeNzwyqpSpbJCQkJUrVp1LViwQI0bN2YlFgDghNjEHQAAAECpvPfevzVx4gTt2Zus3Ny8E4ZX1qFDh3XgQIGysrL05ptvasqUKTp48KAAADgeVmABAAAAOG12ONGlc3ttS0oy4VWBTsfVV1+t559\u002FXpGRlBMCAH4aK7AAAAAAnJa83Gzt3btD6RnZyssr1Oka9903OvvMIdq9a6eYXwcA\u002FBQ2cQcAAABwWtasXacJE8YpJye3VMGT\u002FfNbt+1QUVGRAAD4KQRYAAAAAE7LwoWL9Oc\u002F\\u002F\u002F\u002F3\u002FfE+lSpWO+f3Rn5cn9rEf\u002Ffgr8nMBAAAQjAiwgHLgpwZiJ4PBGVA+\u002FFQbcOjQIX30wRvKy8v1\u002Fv\u002FmLZu0aXOSVqzY4L33q1ULUXhYiC6\u002F\u002FBJFhIepcuXKGjb8TMXH11RUdOxP\u002FjvB0Gb81HNRVFSoHdu3asrk77zPk\u002Fcla8H8RdqatFcHDhR4j6tfv65qUL+u+WjgfU\u002F9Bo016szzf\u002FLfoO0EAAAIPAIsIMgdOnRQmzdvUFFhgfe5XXGRlpahpO27jnxP1apV1LJlM4WFVvc+t4Ov6JhY1a3bwPy+MoMxIEgdPFikgoIDmjVzurJzck1YVXDk\u002F9m2YPq0KSosKPBCnV179mjPnn3atm2n9\u002F9DTLtQvXqIZsyYbdqGal5bkJ6Rp8ioGIWHRx7z7zRsWEf16jVQixat5bK01BTt2r1LS5euOPI1+9gPHz6oFBNaLV+20Ptaenq61q3fqH370lVQWOR9LSKiinbu2KXNNbd6nyfUWKeU\u002FdnH\u002FP0hIVVUq2ZN9e3Xzzx3oSb0qyIAAAAEBgEWE